import React, {useState} from 'react';
import './App.css';

function App() {
  const [count, setCount] = useState(0);
  const handleClick = () => {
    setCount(count + 1);
  }
  return (
    <div className="App">
      <div className="container">
        <h1>Welcome to the clicker</h1>
        <div id="amount" className="mt-5">
          <h3>{count}</h3>
          <div id="btns">
            <button className="btn btn-success" onClick={handleClick}>
              Increment
            </button>
            <button className="btn btn-danger">Minus</button>
            <button className="btn btn-info">Double</button>
            <button className="btn btn-warning">Half</button>
            <button className="btn btn-secondary">Zero</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
